import React, { useEffect } from 'react';
import useNetworkStore from './store/useNetworkStore';

const App = () => {
  const { isOnline, checkIfOnline } = useNetworkStore();

  useEffect(() => {
    checkIfOnline();
  }, [checkIfOnline]);

  return (
    <div>
      {isOnline ? 'Online' : 'Offline'}
    </div>
  );
};

export default App;
